import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Card from './Card';
import 'tachyons';
import {robots} from './robots';
// import App from './App';
// import reportWebVitals from './reportWebVitals';

ReactDOM.render(<div><Card id={robots[0].id} name={robots[0].name} email={robots[0].email}/> <Card /><Card/></div>, document.getElementById('root'));

